import React from "react";

import "./welcome.css";

const Welcome = () => {
    const [render, setRender] = React.useState(false);

    const end = () => {
        setRender(false)
    };

    return (
        render && (
            <div className="temp" onAnimationEnd={() => end()}>Hello</div>
        )
    )
};

export default Welcome;
